<div class="col-full entry__main">
			<h2 >Не перейдёт в «Баварию»<br />
<br />
</h2>
			<p class="lead drop-cap">Английский нападающий «Тоттенхэм Хотспур» Гарри Кейн не перейдёт в мюнхенскую «Баварию», сообщает известный инсайдер Фабрицио Романо в социальной сети.<br />
<br />
По информации журналиста, никаких переговоров между сторонами не велось, хотя ранее ряд СМИ сообщал, что данный трансфер возможен. Английский клуб и главный тренер команды Антонио Конте не рассматривают вариант с расставанием с игроком. Ему хотят предложить новый контракт.<br />
<br />
Контракт Кейна с «Тоттенхэмом» действует до июня 2024 года. В минувшем сезоне Кейн провёл за «Тоттенхэм» 50 матчей во всех турнирах, забив 27 голов, а также отдав 10 результативных передач.<br />
<br />
Напомним, ранее Роберт Левандовски сообщил, что его время в немецком клубе закончилось. Форвард выступает за «Баварию» с 2014 года. Контрактное соглашение польского нападающего с мюнхенским клубом истекает в 2023 году.<br />
<br />
